class Solution:
    def maxOperations(self, s: str) -> int:
        s = s.rstrip('1')
        st = []
        cur = 0
        for i in range(len(s)):
            if s[i] == '1':
                cur += 1
            elif cur > 0:
                st.append(cur)
                cur = 0
        out = 0
        s = 0
        print(st)
        for x in st:
            s += x
            out += s

        return out
